import React, { FunctionComponent } from 'react';

import { ParallaxContentContainer } from './parallax.style';

const ParallaxContent: FunctionComponent = (props) => {
    return (
        <ParallaxContentContainer>
            {props.children}
        </ParallaxContentContainer>
    )
}

export default ParallaxContent;
